{"1": "A tree in full greenery with a blue sky background is shown. A leaf is zoomed in showing its internal structure, with all the parts labeled. Particularly, the chlorophyll is shown as abundant green blobs.", "2": "The same tree in autumn with a solemn, calm atmosphere. The tree is shown with colored leaves, the fallen ones on the ground, and some leaves still hanging on branches. A diagram shows the leaf structure again, but this time the colors contribute to the full picture. Chlorophyll blobs are smaller or absent, giving way to the orange and yellow pigments in a complex structure.", "3": "A hands-on experiment scene shows a clear plastic bag with a leaf turning yellow inside. The process depicts a pencil, a plastic bag, and rubbing alcohol as materials with simple instructions. There are other bags with different leaves around, already treated with alcohol, showing the pigments extracted from each one."}

